Network-API/.body:
Wynncraft Network Resource
Server List

GET https://api.wynncraft.com/public_api.php?action=onlinePlayers

Returns which servers are online and which players are on them.
Response
{
    "WC11": [String],
    "WC2": [String],
    "WC3": [String],
    // ...
    "request": {
        "timestamp": Number,
        "version": Number
    }
}



Player Sum

GET https://api.wynncraft.com/public_api.php?action=onlinePlayersSum

Returns the player sum on the Wynncraft network.
Response
{
    "players_online": Number,
    "request": {
        "timestamp": Number,
        "version": Number
    }
}

Search-API/.body:
Wynncraft Search Resource
Name

GET https://api.wynncraft.com/public_api.php?action=statsSearch&search={name}

Returns a list of guild and player names which contain the search query (case-insensitive).
Response
{
    "guilds": [String],
    "players": [String],
    "request": {
        "timestamp": Number,
        "version": Number
    }
}

